window.bookSummaryJSON = "<p><b>They've never wanted forever with anyone else, but fate had other plans.</b></p> <p>Dalton Callaghan has it allâ€”success, money, charm, and good looks. But money can't buy him the only thing he ever wanted: her. The day Dalton's father was imprisoned for fraud and embezzlement, he knew the future he had planned was no longer possible.</p> <p>With a life-altering decision to be made, Dalton sent the only girl he ever loved off to college without him.</p> <p>Naddie Sullivan was in love with the boy next door. They shared all their firsts, from the sandbox to prom and everything in between.</p> <p>They were each other's first. Each other's everything.</p> <p>When Naddie accepts a new job and uproots her successful life in Boston to move to Manhattan, she could never anticipate what fate had in store. Now, she has to make a choice between the career she's worked so hard for and the man she's been in love with her whole life. With so many obstacles to overcome, can these high school sweethearts become the Dominant and submissive they were always destined to be?</p> <p>He's the first man she ever loved and the only Dom she'll ever need.</p> <p><i>This is a second-chance billionaire romance with forced proximity, BDSM, and an HEA.</i></p>"; 
